import React, {Component} from "react";

class Project extends Component {
    state = {
        active: false,
        visited: false,
    }

    render() {
        return(
            <div className="projectContainer animate">
                <div className="projectNameLogo">
                    <h3 className="projectName">{this.props.name}</h3>
                    <img className="projectLogo" src={this.props.logo} alt={this.props.name + "logo"} style={this.props.style}/>
                </div>
                <div><p className="projectDescription">{this.props.description}</p></div>
                <div className="projectMore">MORE</div>
                <div className="projectGallery"></div>
            </div>
        )
    }
}

export default Project;
